    private void BlockIP()
    {
        string ip = GetLanIPAddress();
        string query = "select * from tbl_blockipaddress WHERE blockipaddress_ipaddress='" + global.CheckData(ip) + "'";
        DataRow dr = DbTable.ExecuteSelectRow(query);
        if (dr == null)
        {
            Response.Write(ip);
            Response.End();
        }
    }
    public string GetLanIPAddress()
    {
        //The X-Forwarded-For (XFF) HTTP header field is a de facto standard for identifying the originating IP address of a 
        //client connecting to a web server through an HTTP proxy or load balancer
        string ip = HttpContext.Current.Request.ServerVariables["HTTP_X_FORWARDED_FOR"];

        if (string.IsNullOrEmpty(ip))
        {
            ip = HttpContext.Current.Request.ServerVariables["REMOTE_ADDR"];
        }

        return ip;
    }
   
    protected void btnLogin_Click(object sender, EventArgs e)
    {
        lblMessage.Text = "Invalid User Name / Password";
        InsertUpdate obj = new InsertUpdate();
        string query = "select * from tbl_user where user_username='" + global.CheckData(txtUserName.Text) +
                            "' and user_password='" + global.CheckData(txtPassword.Text) + "'";
        DataRow dr = obj.ExecuteSelectRow(query);
        if (dr != null)
        {
            if (GlobalUtilities.ConvertToInt(dr["user_roleid"]) != 1)
            {
                //BlockIP();
            }
            int userId = GlobalUtilities.ConvertToInt(dr["user_userid"]);
            Session["UserId_Temp"] = userId;
            bool isChangePassword = false;
            if (dr["user_lastpasswordchange"] == DBNull.Value
                || (DateTime.Now - Convert.ToDateTime(dr["user_lastpasswordchange"])).Days > 90)
            {
                isChangePassword = true;
            }
            if (isChangePassword)
            {
                tblChangePassword.Visible = true;
                tblLogin.Visible = false;
            }
            else
            {
                Login();
            }
        }
    }
    private void Login()
    {
        int userId = GlobalUtilities.ConvertToInt(Session["UserId_Temp"]);
        Session.Remove("UserId_Temp");
        if (userId == 0)
        {
            Response.Redirect("~/adminlogin.aspx");
            return;
        }
        string query = "select * from tbl_user where user_userid=" + userId;
        DataRow dr = DbTable.ExecuteSelectRow(query);
        int employeeId = GlobalUtilities.ConvertToInt(dr["user_employeeid"]);
        if (employeeId > 0)
        {
            query = "select * from tbl_employee where employee_employeeid=" + employeeId;
            DataRow drEmployee = DbTable.ExecuteSelectRow(query);
            if (drEmployee != null)
            {
                CustomSession.Session("Login_ManagerId", GlobalUtilities.ConvertToInt(drEmployee["employee_managerid"]));
                CustomSession.Session("Login_BackupPersonId", GlobalUtilities.ConvertToInt(drEmployee["employee_backuppersonid"]));
            }
            //get all next level employees
            query = "select * from tbl_employee where employee_employeeid<>" + employeeId +
                    " AND (employee_backuppersonid=" + employeeId + " OR employee_managerid=" + employeeId + ")";
            DataTable dttblEmp = DbTable.ExecuteSelect(query);
            if (GlobalUtilities.IsValidaTable(dttblEmp))
            {
                string strChildEmployees = "";
                for (int i = 0; i < dttblEmp.Rows.Count; i++)
                {
                    if (i == 0)
                    {
                        strChildEmployees = GlobalUtilities.ConvertToString(dttblEmp.Rows[i]["employee_employeeid"]);
                    }
                    else
                    {
                        strChildEmployees += "," + GlobalUtilities.ConvertToString(dttblEmp.Rows[i]["employee_employeeid"]);
                    }
                }
                CustomSession.Session("Login_ChildEmployees", strChildEmployees);
            }
        }
        if (!GlobalUtilities.ConvertToBool(dr["user_isactive"]))
        {
            HttpContext.Current.Response.Write("You user account is disabled, please contact administrator!");
            return;
        }
        int roleId = GlobalUtilities.ConvertToInt(dr["user_roleid"]);
        CustomSession.Session("Login_IsLoggedIn", true);
        if (roleId == (int)Enum_Role.EXIMAdvisor || roleId == (int)Enum_Role.FEMAAdvisor)//EXIM or FEMA advisor user
        {
            Common.SetSession(GlobalUtilities.ConvertToInt(dr["user_userid"]));
            if (Request.QueryString["url"] == null)
            {
                Response.Redirect("~/advisorhome.aspx");
            }
            else
            {
                Response.Redirect("~/" + Request.QueryString["url"]);
            }
        }
        else if (roleId == (int)Enum_Role.AuditAdvisor)//Audit advisor
        {
            
            Common.SetSession(GlobalUtilities.ConvertToInt(dr["user_userid"]));
           
            if (Request.QueryString["url"] == null)
            {
                Response.Redirect("~/auditadvisorhome.aspx");
            }
            else
            {
                Response.Redirect("~/" + Request.QueryString["url"]);
            }
        }
        else
        {
            Common.Login(dr);
        }
    }
    protected void btnChangePassword_Click(object sender, EventArgs e)
    {
        lblMessage2.Text = "";
        int userId = GlobalUtilities.ConvertToInt(Session["UserId_Temp"]);
        if (userId == 0)
        {
            Response.Redirect("~/adminlogin.aspx");
        }
        string query = "select * from tbl_user WHERE user_userId=" + userId;
        DataRow dr = DbTable.ExecuteSelectRow(query);
        if (txtNewPassword.Text != txtConfirmPassword.Text)
        {
            lblMessage2.Text = "New Password is not matching with Confirm Password!";
            return;
        }
        if (GlobalUtilities.ConvertToString(dr["user_password"]) == txtNewPassword.Text)
        {
            lblMessage2.Text = "Password can not be same as old password.";
            return;
        }
        if (!Custom.IsPasswordStrength(txtNewPassword.Text))
        {
            lblMessage2.Text = "Minimum length of the Password should be 6. <br/>Also Password should contains atlease one alphabet, one number and one special character!";
            return;
        }

        Hashtable hstbl = new Hashtable();
        hstbl.Add("password", txtNewPassword.Text);
        hstbl.Add("lastpasswordchange", "getdate()");
        InsertUpdate obj = new InsertUpdate();
        obj.UpdateData(hstbl, "tbl_user", userId);
        Login();
    }
    private void CheckLastDbBackup()
    {
        InsertUpdate obj = new InsertUpdate();
        DateTime dt = DateTime.Now;
        string query = @"select * from tbl_setting where setting_settingname='Last DB Backup'";
        DataRow dr = DbTable.ExecuteSelectRow(query);
        if (dr != null)
        {
            TimeSpan ts = DateTime.Now.Subtract(Convert.ToDateTime(dr["setting_settingvalue"]));
            if (ts.Days > 7)
            {
                Response.Redirect("~/DBbackup/DbBackup.aspx");
            }
        }
        else
        {
            Response.Redirect("~/DBbackup/DbBackup.aspx");
        }
    }
    private void SMSPackageRenewWarningMsg()
    {
        int RemainingSMS = 0;
        if (CustomSettings.IsSMSPackageEnable)
        {
            if (SMS.CheckSMSValidity_Count(ref RemainingSMS))
            {
                if (RemainingSMS == 0)
                {
                    lblwarningmsg.Text = "Your SMS package is expired, Please renew your SMS package for further SMS Communication. ";
                    lblwarningmsg.Visible = true;
                }
                else if (CustomSettings.SMS_WarningAfter_Count >= RemainingSMS)
                {
                    //ClientScript.RegisterClientScriptBlock(typeof(Page), "Alert", "<script>alert('Your SMS package is going to over,Please renew your SMS package soon for further SMS Communication. ');</script>");
                    lblwarningmsg.Text = "Your SMS package is going to expire, Please renew your SMS package asap for further SMS Communication. ";
                    lblwarningmsg.Visible = true;
                }
            }
        }
    }
